import React from 'react';
import { Typography } from '@mui/material';
import useStyles from './style.js';
import profile from '../../res/profile.jpg';

const AboutPage =(props,ref)=> {
	const classes = useStyles();

	return (
		<div ref={ref} className={classes.aboutPage}>
			<div className={classes.profileBg}>
				<img className={classes.profileImg} src={profile} alt="profile" />
			</div>
			<div className={classes.texts}>
				<Typography className={classes.textTitle} variant="h4">
          {"Hello, I am Samer Alkhodary, and I am a Software Engineer."}
				</Typography>
				<di className={classes.padding} />
				<Typography className={classes.text} variant="h5">
					{'I love programming and coming up with new project ideas to implement whether they were an online multiplayer game, an app or implementing encryption schemes and protocols.'}
				</Typography>
			</div>
		</div>
	);
};
export default React.forwardRef(AboutPage);
